pragma solidity ^0.5.0;

contract Auction {
    address payable public beneficiary;
    address public highestBidder;
    uint public highestBid;
    mapping(address => uint) pendingReturns;
    bool public isAuctionComplete;
    // Constructor
    constructor() public {
        beneficiary = msg.sender;
        isAuctionComplete = false;
    }
    /// Bid on the auction with the value sent
    /// together with this transaction.
    /// The value will only be refunded if the
    /// auction is not won.
    function bid() public payable {
        // Check if auction is live.
        require(isAuctionComplete==false,"Auction is no longer live.");
        // Check for transaction amount is greater than 0.
        require(msg.value>0,"Amount to bid must be greater than 0");
        // Check if beneficiary is trying to bid.
        require(msg.sender!=beneficiary,"Beneficiary cannot bid.");
        // Check if the amount greater than highestBid
        require(msg.value > highestBid, "Bidding amount cannot be lower than the highest bid.");
        // Store previous highestBidder and highestBid in the pendingReturns.
        pendingReturns[highestBidder] += highestBid;
        // Update highest bidder and highest bid.
        highestBidder = msg.sender;
        highestBid = msg.value;
    }

    function withdraw() public returns (bool) {
        // Check if beneficiary.
        require(msg.sender != beneficiary,"Beneficiary cannot withdraw amount as amount is already transfered.");
        uint pendingBidOfSender;
        pendingBidOfSender = pendingReturns[msg.sender];
        pendingReturns[msg.sender] = 0;
        // Check if already withdrawn(avoid reEntrancy).
        require(pendingBidOfSender > 0,"Amount is already withdrawn by the sender.");
        // If sending success return true else retur false.
        if (!msg.sender.send(pendingBidOfSender)){
            return false;
        }
        return true;
    }

    /// End the auction and send the highest bid
    /// to the beneficiary.
    function auctionEnd() public {
        // Check if auction is live.
        require(isAuctionComplete == false, "Auction already ended");
        // Only beneficiary can trigger autionEnd.
        require(msg.sender == beneficiary,"Only beneficiary can trigger autionEnd");
        uint highestBidAmount = highestBid;
        highestBid = 0;
        // Set auction to end.
        isAuctionComplete = true;
        // Transfer to the highest bid to beneficiary.
        beneficiary.transfer(highestBidAmount);
    }
}
